s.x:
var $bm_rt;
var heightScale, widthScale, usedScale;
heightScale = $bm_div(thisComp.height, 1080);
widthScale = $bm_div(thisComp.width, 1920);
usedScale = $bm_mul(Math.max(heightScale, widthScale), 100);
